text:
This afternoon, I had the pleasure of meeting with New Jersey truck dealers from the New Jersey Coalition of Automotive Retailers (NJ CAR) to hear their priorities and concerns on behalf of their dealerships, employees, and the customers they serve across the Garden State.
 
@NJCAR1918 is the statewide trade association representing more than 500 franchised new auto and truck dealers, a $40 billion industry that generates over $2 billion in state and local tax revenue each year.
 
In Congress, I’ll continue to advocate for pro-growth policies that ensure New Jersey has a strong and thriving automotive sales industry.
